import React from 'react';
import Digit from './Digit';
import Input from './Input';

class Calculator extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			value1: null,
			value2: null,
			currentVal: null,
			answer: null,
			isSecond: false
		};
	}

	render() {
		return (
			<div>
				<Input />
				<Digit value = {1} />
				<Digit value = {2} />
				<Digit value = {3} />
			    <Digit value = {4} />
			    <Digit value = {5} />
			    <Digit value = {6} />
				<Digit value = {7} />
				<Digit value = {8} />
				<Digit value = {9} />
				<Digit value = {0} />

				//<Digit value = {'-'} />
				//<Digit value = {'+'} />
				//<Digit value = {'*'} />
				<Digit value = {'/'} />	
				<Digit value = {'='} />	
			</div>
		);
	}
}

export default Calculator;
